l = loopVal;mnPB.rm = mwPB->rm;mnPB.cs = mwPB->codeSection;buffer = NewPtr(0x210000);if(!buffer){DebugFunction("\pMemory Allocation Error");}bm = 0;zzz=0;//----------if(!currLabelList){goto nolabels;}//----------for(instIndex=0;instIndex<loopVal;instIndex++){zzz++;//if(instIndex==438){Debugger();}if(instIndex==currLabelList->index){write_RETURNtop:;WRITE_(currLabelList->label[0],((currLabelList->label)+1))write_RETURNcurrLabelList = currLabelList->next;if(currLabelList==nil){goto nomorelabels;}if(instIndex==currLabelList->index){goto top;}}/*#ifdef __POWERPC__GetKeys(keyMap);if(keyMap[1] == 0x00808000){gAborted=true;goto abort;}SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endif*/SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));#ifdef __POWERPC__if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endifmnPB.i 	= mwPB->codeSection[instIndex];mnPB.s = instIndex;//opCode[(mwPB->codeSection[instIndex]&0xFC000000)>>26](&mnPB);#include "DisOPs.c"if(bm>=0x200000){	count = bm;	FSWrite(mwPB->outFRef,&count,buffer);	(*mwPB->totalWritten)+=count;	bm=0;}}if(instIndex==currLabelList->index){write_RETURNtop2:;WRITE_(currLabelList->label[0],((currLabelList->label)+1))write_RETURNcurrLabelList = currLabelList->next;if(currLabelList==nil){goto abort;}if(instIndex==currLabelList->index){goto top2;}}/*--------------------------------MNEMONIC WRITER------------------------------------------------------------------------*/goto abort;nolabels:;for(instIndex=0;instIndex<loopVal;instIndex++){zzz++;/*#ifdef __POWERPC__GetKeys(keyMap);if(keyMap[1] == 0x00808000){gAborted=true;goto abort;}SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endif*/SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));#ifdef __POWERPC__if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endifmnPB.i 	= mwPB->codeSection[instIndex];mnPB.s = instIndex;//opCode[(mwPB->codeSection[instIndex]&0xFC000000)>>26](&mnPB);#include "DisOPs.c"if(bm>=0x200000){	count = bm;	FSWrite(mwPB->outFRef,&count,buffer);	(*mwPB->totalWritten)+=count;	bm=0;}}goto abort;for(;instIndex<loopVal;instIndex++){nomorelabels:;/*#ifdef __POWERPC__GetKeys(keyMap);if(keyMap[1] == 0x00808000){gAborted=true;goto abort;}SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endif*/SetControl32BitValue(gAppControls.progressBar,(instIndex/1000));#ifdef __POWERPC__if(!(zzz%1000)){ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);}#endifmnPB.i 	= mwPB->codeSection[instIndex];mnPB.s = instIndex;//opCode[(mwPB->codeSection[instIndex]&0xFC000000)>>26](&mnPB);#include "DisOPs.c"if(bm>=0x200000){	count = bm;	FSWrite(mwPB->outFRef,&count,buffer);	(*mwPB->totalWritten)+=count;	bm=0;}}abort:;if(bm){	count = bm;	FSWrite(mwPB->outFRef,&count,buffer);	(*mwPB->totalWritten)+=count;	bm=0;}//SetControl32BitMaximum(gProgBar,gLabelListSize/100);WriteStatus("Cleaning Up...");#ifdef __POWERPC__boolVal=true;SetControlData(gAppControls.progressBar,kControlEntireControl,kControlProgressBarIndeterminateTag,sizeof(Boolean),&boolVal);DrawControls(gAppWindow);#endifcounter=0;currLabelList = mwPB->labelList;if(currLabelList){	while(currLabelList)	{	#ifdef __POWERPC__	if(!(counter%1000)){IdleControls(GetFrontWindowOfClass(kAllWindowClasses,0));}	#endif	counter++;	DisposePtr(currLabelList->label);	tempLL = currLabelList;	currLabelList = currLabelList->next;	DisposePtr((char*)tempLL);	}}#ifdef __POWERPC__boolVal=false;SetControlData(gAppControls.progressBar,kControlEntireControl,kControlProgressBarIndeterminateTag,sizeof(Boolean),&boolVal);SetControl32BitValue(gAppControls.progressBar,0);ReceiveNextEvent(0,NULL,kEventWaitTime,false,NULL);#endifWriteStatus("Idle");DisposePtr(buffer);}void OP_03(MnemonicPBlock *mnPB){WRITE_(3,"twi")write_TAB;write_TAB;write_TABNumToString(((mnPB->i&0x03E00000)>>21),gtempstr);WRITE_(gtempstr[0],(gtempstr+1))write_COMMAWRITE_(1,"r")NumToString(((mnPB->i&0x001F0000)>>16),gtempstr);WRITE_(gtempstr[0],(gtempstr+1))write_COMMAif((mnPB->i&0x0000FFFF)&0x00008000){NumToString(((mnPB->i&0x0000FFFF)+0xFFFF0000),gtempstr);}else{NumToString((mnPB->i&0x0000FFFF),gtempstr);}WRITE_(gtempstr[0],(gtempstr+1))write_RETURN}void OP_04(MnemonicPBlock *mnPB){switch(mnPB->i&0x0000007FF){case 0:OP_04_SUB_0000(mnPB);break;case 64:OP_04_SUB_0064(mnPB);break;case 128:OP_04_SUB_0128(mnPB);break;case 512:OP_04_SUB_0512(mnPB);break;case 576:OP_04_SUB_0576(mnPB);break;case 640:OP_04_SUB_0640(mnPB);break;case 768:OP_04_SUB_0768(mnPB);break;case 832:OP_04_SUB_0832(mnPB);break;case 896:OP_04_SUB_0896(mnPB);break;case 1024:OP_04_SUB_1024(mnPB);break;case 1088:OP_04_SUB_1088(mnPB);break;case 1152:OP_04_SUB_1152(mnPB);break;case 1408:OP_04_SUB_1408(mnPB);break;case 1536:OP_04_SUB_1536(mnPB);break;case 1600:OP_04_SUB_1600(mnPB);break;case 1664:OP_04_SUB_1664(mnPB);break;case 1792:OP_04_SUB_1792(mnPB);break;case 1856:OP_04_SUB_1856(mnPB);break;case 1920:OP_04_SUB_1920(mnPB);break;case 2:OP_04_SUB_0002(mnPB);break;case 66:OP_04_SUB_0066(mnPB);break;case 130:OP_04_SUB_0130(mnPB);break;case 258:OP_04_SUB_0258(mnPB);break;case 322:OP_04_SUB_0322(mnPB);break;case 386:OP_04_SUB_0386(mnPB);break;case 514:OP_04_SUB_0514(mnPB);break;case 578:OP_04_SUB_0578(mnPB);break;case 642:OP_04_SUB_0642(mnPB);break;case 770:OP_04_SUB_0770(mnPB);break;case 834:OP_04_SUB_0834(mnPB);break;case 898:OP_04_SUB_0898(mnPB);break;case 1026:OP_04_SUB_1026(mnPB);break;case 1090:OP_04_SUB_1090(mnPB);break;case 1154:OP_04_SUB_1154(mnPB);break;cas